import "../App.css";
import React, { useState, useEffect } from "react";
import Table from "react-bootstrap/Table";
import axios from "axios";

const CreateSession = () => {
  const [data, setData] = useState([]);

  const createSesssionRequest = {
    method: "POST",
    headers: { "Content-Type": "application/json" },
  };

  const savedUser = localStorage.getItem('restaurantFinderUserId');
  const userId = JSON.parse(savedUser);
  try {
    axios
      .post(`http://localhost:8080/restaurant/api/v1/createSession/${userId}`)
      .then((response) => {
        setData({
          sessionId: response.data.sessionId,
          sessionRequestedBy: response.data.sessionRequestedBy,
          message: response.data.message,
          statusCode: response.data.statusCode
        });
        console.log(response);
        console.log(response.data);
        if(response != null && response.data != null && response.data.statusCode == 200) {
          localStorage.setItem("restaurantFinderSessionId", JSON.stringify(response.data.sessionId));
        } 
      });
  } catch (error) {
    console.error("Error fetching data:", error);
    window.location = "/error"; 
  }


  useEffect(() => {
    axios
      .post(`http://localhost:8080/restaurant/api/v1/createSession/${userId}`)
      .then((res) => {
        setData(res.data);
      })
      .catch((err) => console.log(err));
  }, []);



  if(data.statusCode ==200) {
    return (
      <Table striped bordered hover size="sm">
        <thead>
          <tr>
            <th>Session Id</th>
            <th>Session Requested By</th>
            <th>Status</th>
          </tr>
        </thead>

        <tbody>
          {
            <tr key={data.sessionId}>
              <td>{data.sessionId}</td>
              <td>{data.sessionRequestedBy}</td>
              <td>{data.message}</td>
            </tr>
          }
        </tbody>
      </Table>
    );
  } else {
    return (
      <Table striped bordered hover size="sm">
        <thead>
          <tr>
            <th>Message</th>
          </tr>
        </thead>

        <tbody>
          {
            <tr key={data.message}>
              <td>{data.message}</td>
            </tr>
          }
        </tbody>
      </Table>
    );
  }

};
export default CreateSession;
